		<script>

			var container = document.getElementById( 'container' );
			var scene;
			var camera;
			var renderer;
			var controls;
			var mouseDown = false;

			// physics scene

			var grabber;

			var physicsParams = {
				gravity : [0.0, -10.0, 0.0],
				timeStep : 1.0 / 60.0,
				numSubsteps : 5,
				friction : 1000.0,
				worldBounds : [-2.5,-1.0, -2.5, 2.5, 10.0, 2.5],
			};

			var physicsScene = {
				softBodies : [],
			};

			// ------------------------------------------------------------------
			class SoftBody {
				constructor(vertices, tetIds, tetEdgeIds, density, devCompliance, volCompliance, 
					visVerts, visTriIds, visMaterial)
				{
					// physics data 

					this.numParticles = vertices.length / 3;
					this.numElems = tetIds.length / 4;

					this.pos = vertices.slice(0);
					this.prevPos = vertices.slice(0);
					this.vel = new Float32Array(3 * this.numParticles);
					this.invMass = new Float32Array(this.numParticles);
					this.invRestPose = new Float32Array(9 * this.numElems);
					this.tetIds = tetIds;
					this.volError = 0.0;

					this.grabPos = new Float32Array(3);
					this.grabId = -1;

					this.devCompliance = devCompliance;
					this.volCompliance = volCompliance;

					// solve data: define here to avoid memory allocation during solve

					this.P = new Float32Array(9);		
					this.F = new Float32Array(9);
					this.dF = new Float32Array(9);
					this.grads = new Float32Array(12);		

					this.initPhysics(density);

					// visual edge mesh

					var geometry = new THREE.BufferGeometry();
					geometry.setAttribute('position', new THREE.BufferAttribute(vertices, 3));
					geometry.setIndex(tetEdgeIds);
					this.edgeMesh = new THREE.LineSegments(geometry);
					this.edgeMesh.userData = this;	// for raycasting
//					this.edgeMesh.layers.enable(1);
					this.edgeMesh.visible = showTetMesh;

					// visual embedded mesh

					this.visVerts = visVerts;
					this.numVisVerts = visVerts.length / 4;
					geometry = new THREE.BufferGeometry();
					geometry.setAttribute('position', new THREE.BufferAttribute(
						new Float32Array(3 * this.numVisVerts), 3));
					geometry.setIndex(visTriIds);
					this.visMesh = new THREE.Mesh(geometry, visMaterial);
					this.visMesh.castShadow = true;
					this.visMesh.userData = this;	// for raycasting
					this.visMesh.layers.enable(1);
					geometry.computeVertexNormals();
					this.updateVisMesh();
				}

				initPhysics(density)
				{
					for (let i = 0; i < this.numParticles; i++)
						this.invMass[i] = 0.0;

					for (let i = 0; i < this.numElems; i++) {
						var id0 = this.tetIds[4 * i];
						var id1 = this.tetIds[4 * i + 1];
						var id2 = this.tetIds[4 * i + 2];
						var id3 = this.tetIds[4 * i + 3];
						vecSetDiff(this.invRestPose, 3 * i,     this.pos,id1, this.pos,id0);
						vecSetDiff(this.invRestPose, 3 * i + 1, this.pos,id2, this.pos,id0);
						vecSetDiff(this.invRestPose, 3 * i + 2, this.pos,id3, this.pos,id0);
						var V = matGetDeterminant(this.invRestPose, i) / 6.0;
						matSetInverse(this.invRestPose, i);
						var pm = V / 4.0 * density;
						this.invMass[id0] += pm;
						this.invMass[id1] += pm;
						this.invMass[id2] += pm;
						this.invMass[id3] += pm;
					}

					for (let i = 0; i < this.numParticles; i++) {
						if (this.invMass[i] != 0.0)
							this.invMass[i] = 1.0 / this.invMass[i];
					}

				}

				// ----------------- begin solver -----------------------------------------------------				

				solveElem(elemNr, dt) 
				{
					var C = 0.0;
					let g = this.grads;
					let ir = this.invRestPose;

					// tr(F) = 3

					var id0 = this.tetIds[4 * elemNr];
					var id1 = this.tetIds[4 * elemNr + 1];
					var id2 = this.tetIds[4 * elemNr + 2];
					var id3 = this.tetIds[4 * elemNr + 3];

					vecSetDiff(this.P,0, this.pos,id1, this.pos,id0);
					vecSetDiff(this.P,1, this.pos,id2, this.pos,id0);
					vecSetDiff(this.P,2, this.pos,id3, this.pos,id0);

					matSetMatProduct(this.F,0, this.P,0, this.invRestPose,elemNr);

					vecSetZero(g,1);
					vecAdd(g,1, this.F,0, 2.0 * matIJ(ir,elemNr, 0,0));
					vecAdd(g,1, this.F,1, 2.0 * matIJ(ir,elemNr, 0,1));
					vecAdd(g,1, this.F,2, 2.0 * matIJ(ir,elemNr, 0,2));

					vecSetZero(g,2);
					vecAdd(g,2, this.F,0, 2.0 * matIJ(ir,elemNr, 1,0));
					vecAdd(g,2, this.F,1, 2.0 * matIJ(ir,elemNr, 1,1));
					vecAdd(g,2, this.F,2, 2.0 * matIJ(ir,elemNr, 1,2));

					vecSetZero(g,3);
					vecAdd(g,3, this.F,0, 2.0 * matIJ(ir,elemNr, 2,0));
					vecAdd(g,3, this.F,1, 2.0 * matIJ(ir,elemNr, 2,1));
					vecAdd(g,3, this.F,2, 2.0 * matIJ(ir,elemNr, 2,2));

					C = vecLengthSquared(this.F,0) + vecLengthSquared(this.F,1) + vecLengthSquared(this.F,2) - 3.0;

					this.applyToElem(elemNr, C, this.devCompliance, dt);
					
					// det F = 1

					vecSetDiff(this.P,0, this.pos,id1, this.pos,id0);
					vecSetDiff(this.P,1, this.pos,id2, this.pos,id0);
					vecSetDiff(this.P,2, this.pos,id3, this.pos,id0);

					matSetMatProduct(this.F,0, this.P,0, this.invRestPose,elemNr);

					vecSetCross(this.dF,0, this.F,1, this.F,2);
					vecSetCross(this.dF,1, this.F,2, this.F,0);
					vecSetCross(this.dF,2, this.F,0, this.F,1);

					vecSetZero(g,1);
					vecAdd(g,1, this.dF,0, matIJ(ir,elemNr, 0,0));
					vecAdd(g,1, this.dF,1, matIJ(ir,elemNr, 0,1));
					vecAdd(g,1, this.dF,2, matIJ(ir,elemNr, 0,2));

					vecSetZero(g,2);
					vecAdd(g,2, this.dF,0, matIJ(ir,elemNr, 1,0));
					vecAdd(g,2, this.dF,1, matIJ(ir,elemNr, 1,1));
					vecAdd(g,2, this.dF,2, matIJ(ir,elemNr, 1,2));

					vecSetZero(g,3);
					vecAdd(g,3, this.dF,0, matIJ(ir,elemNr, 2,0));
					vecAdd(g,3, this.dF,1, matIJ(ir,elemNr, 2,1));
					vecAdd(g,3, this.dF,2, matIJ(ir,elemNr, 2,2));

					C = matGetDeterminant(this.F,0) - 1.0;
					this.volError += C;
					
					this.applyToElem(elemNr, C, this.volCompliance, dt);
				}

				applyToElem(elemNr, C, compliance, dt) 
				{
					if (C == 0.0)
						return;
					let g = this.grads;

					vecSetZero(g,0);
					vecAdd(g,0, g,1, -1.0);
					vecAdd(g,0, g,2, -1.0);
					vecAdd(g,0, g,3, -1.0);
			
					let w = 0.0;
					for (let i = 0; i < 4; i++) {
						let id = this.tetIds[4 * elemNr + i];
						w += vecLengthSquared(g,i) * this.invMass[id];
					}

					if (w == 0.0) 
						return;
					var alpha = compliance / dt / dt;
					var dlambda = -C / (w + alpha);

					for (let i = 0; i < 4; i++) {
						let id = this.tetIds[4 * elemNr + i];
						vecAdd(this.pos,id, g,i, dlambda * this.invMass[id]);
					}
				}

				simulate(dt, gravity)
				{
					// XPBD prediction

					for (let i = 0; i < this.numParticles; i++) {
						vecAdd(this.vel,i, gravity,0, dt);
						vecCopy(this.prevPos,i, this.pos,i);
						vecAdd(this.pos,i, this.vel,i, dt);
					}

					// solve

					this.volError = 0.0;
					for (let i = 0; i < this.numElems; i++) 
						this.solveElem(i, dt);
					this.volError /= this.numElems;

					// ground collision

					for (let i = 0; i < this.numParticles; i++) {

						vecSetClamped(this.pos,i, physicsParams.worldBounds,0, 
							physicsParams.worldBounds,1);

						if (this.pos[3 * i + 1] < 0.0) {
							this.pos[3 * i + 1] = 0.0;

							// simple friction
							vecSetDiff(this.F,0, this.prevPos,i, this.pos,i);

							this.pos[3 * i] += this.F[0] * Math.min(1.0, dt * physicsParams.friction);
							this.pos[3 * i + 2] += this.F[2] * Math.min(1.0, dt * physicsParams.friction);

							// this.pos[3 * i] = this.prevPos[3 * i];
							// this.pos[3 * i + 2] = this.prevPos[3 * i + 2];
						}

					}

					if (this.grabId >= 0) {
						vecCopy(this.pos,this.grabId, this.grabPos,0);
					}

					// XPBD velocity update

					for (let i = 0; i < this.pos.length; i++) 
						vecSetDiff(this.vel,i, this.pos,i, this.prevPos,i, 1.0 / dt);

					if (!grabber.physicsObject) 
						controls.enabled = true;
				}

				// ----------------- end solver -----------------------------------------------------				

				endFrame() 
				{
					this.updateEdgeMesh();
					this.updateVisMesh();
				}

				updateEdgeMesh()
				{
					if (!showTetMesh)
						return;
					const positions = this.edgeMesh.geometry.attributes.position.array;
					for (let i = 0; i < this.pos.length; i++) 
						positions[i] = this.pos[i];
					this.edgeMesh.geometry.attributes.position.needsUpdate = true;
					this.edgeMesh.geometry.computeBoundingSphere();
				}

				updateVisMesh()
				{
					const positions = this.visMesh.geometry.attributes.position.array;
					var nr = 0;
					for (let i = 0; i < this.numVisVerts; i++) {
						var tetNr = this.visVerts[nr++] * 4;
						var b0 = this.visVerts[nr++];
						var b1 = this.visVerts[nr++];
						var b2 = this.visVerts[nr++];
						var b3 = 1.0 - b0 - b1 - b2;
						var id0 = this.tetIds[tetNr++];
						var id1 = this.tetIds[tetNr++];
						var id2 = this.tetIds[tetNr++];
						var id3 = this.tetIds[tetNr++];
						vecSetZero(positions,i);
						vecAdd(positions,i, this.pos,id0, b0);
						vecAdd(positions,i, this.pos,id1, b1);
						vecAdd(positions,i, this.pos,id2, b2);
						vecAdd(positions,i, this.pos,id3, b3);
					}
					this.visMesh.geometry.computeVertexNormals();
					this.visMesh.geometry.attributes.position.needsUpdate = true;
					this.visMesh.geometry.computeBoundingSphere();
				}

				startGrab(pos) 
				{
					var p = [pos.x, pos.y, pos.z];
					var minD2 = Number.MAX_VALUE;
					this.grabId = -1;
					for (let i = 0; i < this.numParticles; i++) {
						var d2 = vecDistSquared(p,0, this.pos,i);
						if (d2 < minD2) {
							minD2 = d2;
							this.grabId = i;
						}
					}
					vecCopy(this.grabPos,0, p,0);
				}

				moveGrabbed(pos) 
				{
					var p = [pos.x, pos.y, pos.z];
					vecCopy(this.grabPos,0, p,0);
				}

				endGrab() 
				{
					this.grabId = -1;

				}
			}

			// ------------------------------------------------------------------
			function initPhysics() 
			{
				var density = 1.0
				var devCompliance = 0.0;
				var volCompliance = 0.0;
				var visMaterial = new THREE.MeshPhongMaterial({color: 0xf78a1d});
								;
				var dragon = new SoftBody(dragonTetVerts, dragonTetIds, dragonTetEdgeIds, 
					density, devCompliance, volCompliance, 
					dragonAttachedVerts, dragonAttachedTriIds, visMaterial);

				physicsScene.softBodies.push(dragon);
				scene.add(dragon.edgeMesh);
				scene.add(dragon.visMesh);
			}

			// ------------------------------------------------------------------
			function simulate() 
			{
				var dt = physicsParams.timeStep / physicsParams.numSubsteps;

				for (let step = 0; step < physicsParams.numSubsteps; step++) {
					for (let i = 0; i < physicsScene.softBodies.length; i++) {
						physicsScene.softBodies[i].simulate(dt, physicsParams.gravity);
					}
				}
				for (let i = 0; i < physicsScene.softBodies.length; i++) {
					physicsScene.softBodies[i].endFrame();
				}
			}

			// ------------------------------------------
					
			function initThreeScene() 
			{
				scene = new THREE.Scene();
				
				// Lights
				
				scene.add( new THREE.AmbientLight( 0x505050 ) );	
				scene.fog = new THREE.Fog( 0x000000, 0, 15 );				

				var spotLight = new THREE.SpotLight( 0xffffff );
				spotLight.angle = Math.PI / 5;
				spotLight.penumbra = 0.2;
				spotLight.position.set( 2, 3, 3 );
				spotLight.castShadow = true;
				spotLight.shadow.camera.near = 3;
				spotLight.shadow.camera.far = 10;
				spotLight.shadow.mapSize.width = 1024;
				spotLight.shadow.mapSize.height = 1024;
				scene.add( spotLight );

				var dirLight = new THREE.DirectionalLight( 0x55505a, 1 );
				dirLight.position.set( 0, 3, 0 );
				dirLight.castShadow = true;
				dirLight.shadow.camera.near = 1;
				dirLight.shadow.camera.far = 10;

				dirLight.shadow.camera.right = 1;
				dirLight.shadow.camera.left = - 1;
				dirLight.shadow.camera.top	= 1;
				dirLight.shadow.camera.bottom = - 1;

				dirLight.shadow.mapSize.width = 1024;
				dirLight.shadow.mapSize.height = 1024;
				scene.add( dirLight );
				
				// Geometry

				var material = new THREE.MeshPhongMaterial( {
					color: 0x80ee10,
					shininess: 100,
					side: THREE.DoubleSide
				} );

				var ground = new THREE.Mesh(
					new THREE.PlaneBufferGeometry( 20, 20, 1, 1 ),
					new THREE.MeshPhongMaterial( { color: 0xa0adaf, shininess: 150 } )
				);				

				ground.rotation.x = - Math.PI / 2; // rotates X/Y to X/Z
				ground.receiveShadow = true;
				scene.add( ground );
				
				var helper = new THREE.GridHelper( 20, 20 );
				helper.material.opacity = 1.0;
				helper.material.transparent = true;
				helper.position.set(0, 0.002, 0);
				scene.add( helper );				
				
				// Renderer

				renderer = new THREE.WebGLRenderer();
				renderer.shadowMap.enabled = true;
				renderer.setPixelRatio( window.devicePixelRatio );
				renderer.setSize( 0.95 * window.innerWidth, 0.95 * window.innerHeight );
				window.addEventListener( 'resize', onWindowResize, false );
				container.appendChild( renderer.domElement );
				
				// Camera
						
				camera = new THREE.PerspectiveCamera( 70, window.innerWidth / window.innerHeight, 0.01, 100);
			    camera.position.set(0, 1, 4);
				camera.updateMatrixWorld();	

				scene.add( camera );
				grabber = new Grabber(scene, renderer, camera);

				controls = new THREE.OrbitControls(camera, renderer.domElement);
    			controls.zoomSpeed = 2.0;
    			controls.panSpeed = 0.4;

				container.addEventListener( 'pointerdown', onPointer, false );
				container.addEventListener( 'pointermove', onPointer, false );
				container.addEventListener( 'pointerup', onPointer, false );
				container.addEventListener( 'pointerout', onPointer, false );
			}

			function onWindowResize() {

				camera.aspect = window.innerWidth / window.innerHeight;
				camera.updateProjectionMatrix();
				renderer.setSize( window.innerWidth, window.innerHeight );
			}

			// ---------------------------------------------------------------------

			class Grabber {
				constructor(scene, renderer, camera)
				{
					this.scene = scene;
					this.renderer = renderer;
					this.camera = camera;
					this.mousePos = new THREE.Vector2();
					this.raycaster = new THREE.Raycaster();
					this.raycaster.layers.set(1);
//					this.raycaster.params.Mesh.threshold = 3;
					this.raycaster.params.Line.threshold = 0.1;
					this.grabDistance = 0.0;
					this.active = false;
					this.physicsObject = null;
				}
				updateRaycaster(x, y) {
					var rect = this.renderer.domElement.getBoundingClientRect();	
					this.mousePos.x = ((x - rect.left) / rect.width ) * 2 - 1;
					this.mousePos.y = -((y - rect.top) / rect.height ) * 2 + 1;
					this.raycaster.setFromCamera( this.mousePos, camera );
				}
				start(x, y) {
					this.physicsObject = null;
					this.updateRaycaster(x, y);
					var intersects = this.raycaster.intersectObjects( scene.children );
					if (intersects.length > 0) {
						var obj = intersects[0].object.userData;
						if (obj instanceof SoftBody) {
							this.physicsObject = obj;
							this.grabDistance = intersects[0].distance;
							let hit = this.raycaster.ray.origin.clone();
							hit.addScaledVector(this.raycaster.ray.direction, this.grabDistance);
							this.physicsObject.startGrab(hit);
							this.active = true;
						}
						if (paused)
							run();						
					}
				}
				move(x, y) {
					if (this.active) {
						this.updateRaycaster(x, y);
						let hit = this.raycaster.ray.origin.clone();
						hit.addScaledVector(this.raycaster.ray.direction, this.grabDistance);
						if (this.physicsObject != null)
							this.physicsObject.moveGrabbed(hit);
					}
				}
				end() {
					if (this.active) { 
						if (this.physicsObject != null) {
							this.physicsObject.endGrab();
							this.physicsObject = null;
						}
						this.active = false;
					}
					this.physicsObject = null;
				}
			}

			// ------------------------- callbacks ---------------------------------------------

			function onPointer( evt ) 
			{
//				event.preventDefault();
				if (evt.type == "pointerdown") {
					grabber.start(evt.clientX, evt.clientY);
					if (grabber.physicsObject) {
						controls.saveState();
						controls.enabled = false;
					}
					mouseDown = true;
				}
				else if (evt.type == "pointermove" && mouseDown) {
					if (grabber.active)
						grabber.move(evt.clientX, evt.clientY);
				}
				else if (evt.type == "pointerup"/* || evt.type == "pointerout"*/) {
					if (grabber.physicsObject) {
						grabber.end();
						controls.reset();
						controls = new THREE.OrbitControls(camera, renderer.domElement);
		    			controls.zoomSpeed = 2.0;
    					controls.panSpeed = 0.4;
					}
					mouseDown = false;
				}
				if (!grabber.physicsObject) {
					controls.enabled = true;
				}
			}

			var timeFrames = 0;
			var timeSum = 0;
	
			function animate() 
			{		
				var startTime = performance.now();

				if (!paused)
					simulate();
				renderer.render( scene, camera );
					
				requestAnimationFrame( animate );

				var endTime = performance.now();
				timeSum += endTime - startTime; 
				timeFrames++;

				if (timeFrames > 10) {
					timeSum /= timeFrames;
					document.getElementById("ms").innerHTML = timeSum.toFixed(3);		
					timeFrames = 0;
					timeSum = 0;
				}

				var volError = 0.0;
				for (let i = 0; i < physicsScene.softBodies.length; i++)
					volError += physicsScene.softBodies[i].volError;
				volError /= physicsScene.softBodies.length;
				document.getElementById("error").innerHTML = (volError).toFixed(3);	
			}

			var paused = true;

			function run() {
				var button = document.getElementById('buttonRun');
				if (paused)
					button.innerHTML = "Stop";
				else
					button.innerHTML = "Run";
				paused = !paused;
			}

			function restart() {
				location.reload();
			}

			function squash() {
				for (let i = 0; i < physicsScene.softBodies.length; i++) {
					var s =	physicsScene.softBodies[i];
					for (let j = 0; j < s.pos.length; j++) {
						s.pos[3 * j] += (Math.random() - 0.5) * 0.3;
						s.pos[3 * j + 1] = 0.5;
						s.pos[3 * j + 2] += (Math.random() - 0.5) * 0.3;
					}
					s.updateVisMesh();
				}
				if (!paused)
					run();
			}

			var showTetMesh = false;

			function onTetMesh() {
				showTetMesh = !showTetMesh;
				for (let i = 0; i < physicsScene.softBodies.length; i++)
					physicsScene.softBodies[i].edgeMesh.visible = showTetMesh;
			}

			document.getElementById("stepsSlider").oninput = function() {
				document.getElementById("numSteps").innerHTML = this.value;
				physicsParams.numSubsteps = this.value;
			}

			// ----- vector math -------------------------------------------------------------

			function vecSetZero(a,anr) {
				anr *= 3;
				a[anr++] = 0.0;
				a[anr++] = 0.0;
				a[anr]   = 0.0;
			}

			function vecCopy(a,anr, b,bnr) {
				anr *= 3; bnr *= 3;
				a[anr++] = b[bnr++]; 
				a[anr++] = b[bnr++]; 
				a[anr]   = b[bnr];
			}
			
			function vecAdd(a,anr, b,bnr, scale = 1.0) {
				anr *= 3; bnr *= 3;
				a[anr++] += b[bnr++] * scale; 
				a[anr++] += b[bnr++] * scale; 
				a[anr]   += b[bnr] * scale;
			}

			function vecSetDiff(dst,dnr, a,anr, b,bnr, scale = 1.0) {
				dnr *= 3; anr *= 3; bnr *= 3;
				dst[dnr++] = (a[anr++] - b[bnr++]) * scale;
				dst[dnr++] = (a[anr++] - b[bnr++]) * scale;
				dst[dnr]   = (a[anr] - b[bnr]) * scale;
			}

			function vecLengthSquared(a,anr) {
				anr *= 3;
				let a0 = a[anr], a1 = a[anr + 1], a2 = a[anr + 2];
				return a0 * a0 + a1 * a1 + a2 * a2;
			}

			function vecDistSquared(a,anr, b,bnr) {
				anr *= 3; bnr *= 3;
				let a0 = a[anr] - b[bnr], a1 = a[anr + 1] - b[bnr + 1], a2 = a[anr + 2] - b[bnr + 2];
				return a0 * a0 + a1 * a1 + a2 * a2;
			}

			function vecSetCross(a,anr, b,bnr, c,cnr) {
				anr *= 3; bnr *= 3; cnr *= 3;
				a[anr++] = b[bnr + 1] * c[cnr + 2] - b[bnr + 2] * c[cnr + 1];
				a[anr++] = b[bnr + 2] * c[cnr + 0] - b[bnr + 0] * c[cnr + 2];
				a[anr]   = b[bnr + 0] * c[cnr + 1] - b[bnr + 1] * c[cnr + 0];
			}

			function vecSetClamped(dst,dnr, a,anr, b,bnr) {
				dnr *= 3; anr *= 3; bnr *= 3;
				dst[dnr] = Math.max(a[anr++], Math.min(b[bnr++], dst[dnr++]));
				dst[dnr] = Math.max(a[anr++], Math.min(b[bnr++], dst[dnr++]));
				dst[dnr] = Math.max(a[anr++], Math.min(b[bnr++], dst[dnr++]));
			}

			// ----- matrix math ----------------------------------

			function matIJ(A,anr, row, col) {
				return A[9*anr + 3 * col + row];
			}

			function matSetVecProduct(dst,dnr, A,anr, b,bnr) {
				bnr *= 3; anr *= 3;
				let b0 = b[bnr++];
				let b1 = b[bnr++];
				let b2 = b[bnr];
				vecSetZero(dst,dnr);
				vecAdd(dst,dnr, A,anr++, b0);
				vecAdd(dst,dnr, A,anr++, b1);
				vecAdd(dst,dnr, A,anr,   b2);
			}

			function matSetMatProduct(Dst,dnr, A,anr, B,bnr) {
				dnr *= 3; bnr *= 3;
				matSetVecProduct(Dst,dnr++, A,anr, B,bnr++);
				matSetVecProduct(Dst,dnr++, A,anr, B,bnr++);
				matSetVecProduct(Dst,dnr++, A,anr, B,bnr++);
			}

			function matGetDeterminant(A,anr) {
				anr *= 9;
				let a11 = A[anr + 0], a12 = A[anr + 3], a13 = A[anr + 6];
				let a21 = A[anr + 1], a22 = A[anr + 4], a23 = A[anr + 7];
				let a31 = A[anr + 2], a32 = A[anr + 5], a33 = A[anr + 8];
				return a11*a22*a33 + a12*a23*a31 + a13*a21*a32 - a13*a22*a31 - a12*a21*a33 - a11*a23*a32;
			}

			function matSetInverse(A,anr) {
				let det = matGetDeterminant(A,anr);
				if (det == 0.0) {
					for (let i = 0; i < 9; i++)
						A[anr + i] = 0.0;
						return;
				}
				let invDet = 1.0 / det;
				anr *= 9;
				let a11 = A[anr + 0], a12 = A[anr + 3], a13 = A[anr + 6];
				let a21 = A[anr + 1], a22 = A[anr + 4], a23 = A[anr + 7];
				let a31 = A[anr + 2], a32 = A[anr + 5], a33 = A[anr + 8]
				A[anr + 0] =  (a22 * a33 - a23 * a32) * invDet; 
				A[anr + 3] = -(a12 * a33 - a13 * a32) * invDet;
				A[anr + 6] =  (a12 * a23 - a13 * a22) * invDet;
				A[anr + 1] = -(a21 * a33 - a23 * a31) * invDet;
				A[anr + 4] =  (a11 * a33 - a13 * a31) * invDet;
				A[anr + 7] = -(a11 * a23 - a13 * a21) * invDet;
				A[anr + 2] =  (a21 * a32 - a22 * a31) * invDet;
				A[anr + 5] = -(a11 * a32 - a12 * a31) * invDet;
				A[anr + 8] =  (a11 * a22 - a12 * a21) * invDet;
			}
